class Page extends Component {
  state = {
    corpusList: [],
    searchName: "",
    loading: false,
    pages: {
      currentPage: 1,
      pageSize: 12,
      total: 0
    },
    pageRange: [],
    editModalOpen: false,
    deleteModalOpen: false,
    currentItem: {},
  }

  componentDidMount() {
    this.getData()
  }

  returnTxt(item) {
    return item;
  }

  getStatusType(item) {
    if (item.status === 'True') {
      return 'success'
    } 
    if (item.status === 'False') {
      return 'error'
    }
    if (item.status === 'Deleting') {
      return 'deleting'
    }
    return 'process'
  }

  getDataStatus(isStatus, isTag) {
    return [
      // 导入中
      {
        type: 'primary',
        [isStatus ? 'id' : 'value']: 'process',
        [isStatus || isTag ? 'children' : 'text']: "数据处理中",
      },
      // 连接成功
      {
        type: 'success',
        [isStatus ? 'id' : 'value']: 'success',
        [isStatus || isTag ? 'children' : 'text']: "数据处理完成",
      },
      // 连接异常
      {
        type: 'error',
        [isStatus ? 'id' : 'value']: 'error',
        [isStatus || isTag ? 'children' : 'text']: "数据处理失败",
      },
      // 删除中
      {
        type: 'info',
        [isStatus ? 'id' : 'value']: 'deleting',
        [isStatus || isTag ? 'children' : 'text']: "删除中",
      },
    ];
  }

  onSearch(name) {
    this.setState({
      searchName: name,
      pages: {
        ...this.state.pages,
        currentPage: 1
      }
    }, () => {
      this.getData(name)
    })
  }

  getData() {
    this.setState({
      loading: true
    })
    const project = JSON.parse(localStorage.getItem('authData'))?.project;
    const { currentPage, pageSize } = this.state.pages
    const params = { namespace: project, name: this.state.searchName, page: currentPage, pageSize }
    this.utils.bff.listKnowledgeBases({ input: params }).then(res => {
      const { KnowledgeBase } = res;
      const { listKnowledgeBases } = KnowledgeBase || {};
      const { nodes, totalCount } = listKnowledgeBases || {};

      this.setState({
        corpusList: nodes || [],
        loading: false,
        pages: {
          ...this.state.pages,
          total: totalCount
        }
      })
    }).catch(error => {
      this.setState({
        corpusList: [],
        loading: false
      })
    })
  }

  handlePageSizeChange(size) {
    this.setState({
      pages: {
        ...this.state.pages,
        pageSize: size
      }
    })
  }

  showTotal(total, range) {
    return `共 ${total} 条`;
  }

  onShowSizeChange(current, size) {
    // pageSize 变化的回调
    this.setState({
      pages: {
        ...this.state.pages,
        pageSize: size
      }
    })
  }

  onChange(page, pageSize) {
    // 页码或 pageSize 改变的回调
    this.setState({
      pages: {
        ...this.state.pages,
        currentPage: page,
        pageSize
      }
    }, () => {
      this.getData()
    })
  }

  onDetailClick(e, extParams) {
    this.history.push(`/knowledge/detail/${extParams.data.name}`)
  }

  onCreateClick(event) {
    this.history.push(`/knowledge/create`)
  }

  onMenuClick({ item, key, keyPath, domEvent }, extParams){
    domEvent.stopPropagation();
    this.setState({
      currentItem: extParams.data,
    })
    switch(key) {
      case 'edit': {
        this.setState({
          editModalOpen: true,
        })
      }
        break;
      case 'delete': {
        this.setState({
          deleteModalOpen: true,
        })
      }
        break;
      default:
        break;
    }
  }

  onEditModalOk() {
    this.getData()
    this.setState({
      editModalOpen: false,
    })
  }

	onEditModalCancel(){
    this.setState({
      editModalOpen: false,
    })
  }

  onDeleteModalOk() {
    this.getData()
    this.setState({
      deleteModalOpen: false,
    })
  }

  onDeleteModalCancel() {
    this.setState({
      deleteModalOpen: false,
    })
  }
  stopPropagation(e) {
    e.stopPropagation();
  }
}

